Step-by-step reasoning:
1. Key psychological mechanisms:
 • Proposers likely balance fairness (norm‐driven behavior based on relative contributions; computed as the opponent’s tokens divided by total tokens, scaled to 100) with self-interest (minimizing the opponent’s share, captured by a baseline “selfish offer” m).
2. Interaction mechanics:
 • In each trial, the proposer has a fairness norm computed from the tokens (fair_offer) and a self-interest alternative (m). A binary decision is assumed – choosing either the fair offer or the selfish offer. The utility difference between these options guides a probabilistic choice using a logistic function.
3. Mathematical form:
 • Compute fairness: fairness = 100·token_opp/(token_self + token_opp)
 • Formulate the utility difference U = lambda_param·(fairness – m) + beta.
 • Compute the probability p = 1⁄(1+exp(–U)).
 • The proposed percentage is then a mixture: proposed_perc = m + p·(fairness – m).
4. Learnable parameters:
 • lambda_param (sensitivity to fairness-self-interest difference), β (a baseline bias) and m (selfish offer level) – all with finite generous bounds.
5. Mapping to observable behavior:
 • In each trial, token_opp and token_self (from the dataset) yield a trial-specific fairness norm. The logistic transformation of the weighted difference between this norm and the selfish baseline (m) gives the probability of choosing the fairness option. The final proposed percentage is then the convex combination of the fairness norm and the selfish offer, matching the observed proposer behavior (proposed_perc).

Below is the formal specification.

<MODEL>
fairness = 100 * token_opp / (token_self + token_opp)
p = 1 / (1 + exp(- (lambda_param * (fairness - m) + beta)))
proposed_perc = m + p * (fairness - m)
</MODEL>

